var tipuesearch = {"pages": [{'title': '計算機程式', 'text': '倉儲:\xa0 https://github.com/40823201/cp2019 \n 課程網頁: http://mde.tw/cp2019/content/index.html \n Gist: https://gist.github.com/40823201/d9f7bc5daa98a11de2e1fd3c02a469d9 \n Dartpad: https://dartpad.dartlang.org/?id=d9f7bc5daa98a11de2e1fd3c02a469d9 \n \n  取 Dart 程式的按鈕  \n 放大   回復   Hello   For Loop   Mass_Spring_Damping \n  內建放入的 Dart 原始碼  \n \n', 'tags': '', 'url': '計算機程式.html'}, {'title': 'Work', 'text': '', 'tags': '', 'url': 'Work.html'}, {'title': 'W3', 'text': '原始碼 \n void main() {\n    print("喔耶");\n} \n \n', 'tags': '', 'url': 'W3.html'}, {'title': 'W4', 'text': '上傳圖檔 \n \n', 'tags': '', 'url': 'W4.html'}, {'title': 'W6', 'text': '原始碼 \n int i;\nint sum;\n\nmain(){\n  sum = 0;\n  for(i=1;i <= 10 ;i++){\n    sum += i;\n    print("$sum");\n  }\n  print(\'sum = $sum\');\n} \n \n', 'tags': '', 'url': 'W6.html'}, {'title': 'W7', 'text': "原始碼 \n rungeKutta(t0, x0, t, h) {\n  int n = ((t - t0) / h).toInt();\n  double x = x0;\n  for (int i = 1; i <= n; i++) {\n    double k1 = h * dxdt(t0, x);\n    double k2 = h * dxdt(t0 + 0.5 * h, x + 0.5 * k1);\n    double k3 = h * dxdt(t0 + 0.5 * h, x + 0.5 * k2);\n    double k4 = h * dxdt(t0 + h, x + k3);\n    x = x + (1.0 / 6.0) * (k1 + 2 * k2 + 2 * k3 + k4);\n    t0 = t0 + h;\n  }\n  return x;\n}\n\ndxdt(t, x) {\n  return ((t - x) / 2);\n}\n\nmain() {\n  num t0 = 0;\n  num x = 1;\n  num t = 2;\n  double h = 0.2;\n  print('The value of x at t=$t is: ${rungeKutta(t0, x, t, h)}');\n}\n \n \n", 'tags': '', 'url': 'W7.html'}, {'title': '期中考', 'text': '第一次上傳(無字幕無浮水印，僅有CC字幕) \n https://youtu.be/_CbytFJU-cg \xa0 \n 第二次上傳(無浮水印) \n https://youtu.be/6OZTQdMrGZI \xa0', 'tags': '', 'url': '期中考.html'}, {'title': '上課筆記', 'text': 'IPv6 \n \n 慣用伺服器 -> 2001:b000:168::1 \n 位址 -> 2001:288:6004::17 \n \n 隨身系統 \n \n 開啟 -> start_mde \n 關閉 -> stop.bat \n \n CMD \n \n ipconfig/all (叫出所有與網路相關資訊) \n git add . (新增) \n git commit -m "MESSAGE" \n \n initial add 全部新增 \n add graphics files 新增相片 \n add repository link 新增倉儲連結 \n add embedding dartpad 新增Dartpad \n \n git push (從近端推上遠端) \n git pull (從遠端拉回近端) \n \n \n Proxy \n \n 伺服器位址 -> [2001:288:6004:17::7]:3128\xa0 \xa0 (:3128為連接阜) \n \n 連接Github \n \n Https -> home/.gitconfig \n Ssh -> home/.ssh/config \n \n 設定Proxy \n \n (cmd) git config --global http.proxy [2001:288:6004:17::7]:3128 \n \n 設定身分 \n \n (cmd) git config --global user.name "學號 " \n (cmd) git config --global user.email "學號@mde.tw" \n \n clone到cp 2019 \n \n (cmd) git clone https://github.com/學號/cp2019.git \n \n 新增CMSiMDE \n \n (cmd) git submodule add  https://github.com/mdecourse/cmsimde.git \xa0cmsimde \n \n 啟動近端動態網站 \n \n (cmd) tmp/cp2019/cmsimde/python wsgi.py \n 近端動態網址:https://localhost:9443 \n \n 啟動近端靜態網站 \n \n (SCiTE)開啟 http-server.py \n 使用Tools中的Go來啟動靜態網站 \n 近端靜態網址:https:localhost:8444 \n \n \n \n', 'tags': '', 'url': '上課筆記.html'}]};